  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `call_frequency` int DEFAULT NULL,
  `total_value` int DEFAULT NULL,
  `accountID` int DEFAULT NULL,
  `assigned_to` int DEFAULT NULL,
  PRIMARY KEY (`leadID`),
  KEY `restaurantID` (`restaurantID`),
  KEY `accountID` (`accountID`),
  CONSTRAINT `leads_ibfk_1` FOREIGN KEY (`restaurantID`) REFERENCES `restaurants` (`restaurantID`),
  CONSTRAINT `leads_ibfk_2` FOREIGN KEY (`accountID`) REFERENCES `accounts` (`accountID`)
) ENGINE=InnoDB AUTO_INCREMENT=118 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
