DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orders` (
  `orderID` int NOT NULL AUTO_INCREMENT,
  `productID` int DEFAULT NULL,
  `restaurantID` int DEFAULT NULL,
  `total_price` int DEFAULT NULL,
  `ordered_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `leadID` int DEFAULT NULL,
  `quantity` int DEFAULT NULL,
  `status` enum('new','done','cancelled') DEFAULT 'new',
  PRIMARY KEY (`orderID`),
  KEY `productID` (`productID`),
  KEY `restaurantID` (`restaurantID`),
  KEY `leadID` (`leadID`),
  CONSTRAINT `orders_ibfk_1` FOREIGN KEY (`productID`) REFERENCES `products` (`productID`),
  CONSTRAINT `orders_ibfk_2` FOREIGN KEY (`restaurantID`) REFERENCES `restaurants` (`restaurantID`),
  CONSTRAINT `orders_ibfk_3` FOREIGN KEY (`leadID`) REFERENCES `leads` (`leadID`)
) ENGINE=InnoDB AUTO_INCREMENT=309 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

